import React, { Component } from "react";
let stars = [];
let star = " * ";

function starfill() {
  for (let i = 0; i < 5000; i++) {
    stars.push(star);
  }
}
starfill();

export default class Starback extends Component {
  render() {
    return (
      <div>
        <div className="aboutlist">
          <ul>
            <li>Work</li>
            <li>School</li>
            <li>Other</li>
          </ul>
        </div>
        <div className="stars">{stars}</div>
      </div>
    );
  }
}
